def skew (Genome):
    dict = {}
    integers = []
    for i in range(len(Genome)):
        frame = Genome[:i]
        n_g = frame.count("G")
        n_c = frame.count("C")
        
        dict[i] = n_g - n_c
        
    for k in dict.keys():
        if dict[k] == min(dict.values()): 
            integers.append(str(k))

    print (' '.join(integers))
        
